import { RouteProps, Route, Navigate } from "react-router-dom";
import React, { ComponentType } from "react";

interface PrivateRouteProps {
  element: JSX.Element;
  isLoggedIn: boolean;
}

const PrivateRoute = ({ element, isLoggedIn }: PrivateRouteProps) => {
  return (
    <Route element={isLoggedIn ? element : <Navigate to="/login" replace />} />
  );
};

